import React, {Component} from 'react';
import "../post.css";


class Post extends Component{
  render(){
    return(
      <div className={"post"}>
        <h3>Texto do post</h3>
        <small>15:00</small>
        <p> Likes: 0 </p>
        <button
          style={{
            'backgroundColor':'blue',
            'backgroundImage': 'http://pngimg.com/uploads/like/like_PNG24.png',
            'color':'white',
            'fontSize': 20,
            'fontWeight': 'bold',
            'border': 'none',
            'borderRadius': 10,
            'padding': 5
          }}
        >Like</button>
      </div>
    )
  }
}

export default Post;
